window.bookSummaryJSON = "<p><b>Contains books seven, eight, and nine of the Deliver series. </b></p> <p><i>Unshackle</i>, book seven</p> <p>No woman can resist Luke Sanch’s chiseled features, honed physique, auburn hair, and intense green eyes.</p> <p>While deadly in combat, he’s an indomitable weapon in bed. He can coax an explosive release with only his mouth and annihilate with insidious, mind-blowing pleasure. When he infiltrates La Rocha Cartel, he must seduce Vera Gomez to determine whether to rescue her. Or kill her. Nothing can distract his icy, lethal focus. Except the cartel’s most feral captive. The nameless raven-haired beauty is his key to dismantling Vera Gomez. But the ferocious little fighter challenges him at every turn and unknowingly battles her way into his heart. </p> <p><i>Dominate</i>, book eight</p> <p>There are many reasons to jump off a bridge, but Rylee Sutton only needs one. Her husband’s betrayal. Just before she leaps, she receives an email from a stranger. The boy’s message is meant for his dead girlfriend, but his anguish speaks to Rylee. It saves her life. Over the next decade, Tomas Dine continues to email his dead girl. As he evolves from a teenager into a hardened, vicious criminal, Rylee is there, reading every intimate word. He doesn’t know she exists. When she comes forward, he despises her, his cruelty unforgivable. But she doesn’t back down. In a carnal battle of punishment and passion, hatred dominates. Until he loses her. Amid looming danger and unsolved murders rises a devotion forged in strife. They must fight for answers - and each other.</p> <p><i>Complicate</i>, book nine</p> <p>Cole Hartman is a mystery. He works alone, sleeps alone, and satisfies his aches...alone. He hasn't touched a woman in seven years. No one will ever compare to the one who broke his heart. Until he stares into the seductive eyes of his enemy. </p> <p>He finally meets his match in the redheaded Russian spy. But she's a dangerous risk. His obsession with her leaves him only one choice. If you love something, let it go. If it doesn't kill you, hunt it down and take it.</p>"; 
